var CookiebotDialog, CookieConsentDialog; CookiebotDialog = CookieConsentDialog = new CookieControl.Dialog(CookieConsent,'bottom-v2_customcolor','Questo sito web utilizza i cookie','Per offrirti un\'esperienza di navigazione sempre migliore, questo sito utilizza cookie propri e di terze parti, partner selezionati. I cookie di terze parti potranno anche essere di profilazione.   Leggi la nostra<a href="https://www.aruba.it/cookie-policy.aspx?lang=it-IT" target="_blank" style=""> Informativa sull’uso dei cookie</a>&nbsp;per saperne di più oppure vai su “Personalizza” per gestire le tue impostazioni. Cliccando "Accetta" acconsenti alla memorizzazione dei cookie sul tuo dispositivo. Cliccando su "Rifiuta" accetti la memorizzazione dei soli cookie necessari. ','Accetta tutti i cookie','Rifiuta tutti','inlineoptin',null,false,'strict','it','<p style="">I cookie sono stringhe di testo di piccole dimensioni che i siti visitati dall’utente inviano al suo terminale (solitamente al browser), dove vengono memorizzati, per essere poi ritrasmessi agli stessi siti alla successiva visita del medesimo utente. Nel corso della navigazione su un sito, l’utente può ricevere sul suo terminale anche cookie che vengono inviati da siti o da web server diversi (c.d. "terze parti"), sui quali possono risiedere alcuni elementi (quali, ad esempio, immagini, mappe, suoni, specifici link a pagine di altri domini) presenti sul sito che lo stesso sta visitando.</p><p style="">&nbsp;</p><p style="">Ogni cookie contiene diversi dati come, ad esempio, indirizzo IP, nazionalità, città, data/orario, dispositivo, browser, sistema operativo, risoluzione dello schermo, provenienza di navigazione, pagine visitate e numero di pagine, durata della visita, numero di visite effettuate, ecc.. </p><p style="">&nbsp;</p><p style="">Questo sito utilizza diversi tipi di cookie. Alcuni cookie sono collocati da servizi di terzi che compaiono sulle nostre pagine. Per maggiori informazioni sull’utilizzo dei cookie <a href="https://www.aruba.it/cookie-policy.aspx?lang=it-IT" target="_blank" style="">clicca qui</a>.</p>','I cookie necessari aiutano a contribuire a rendere fruibile un sito web abilitando le funzioni di base come la navigazione della pagina e l\'accesso alle aree protette del sito. Il sito web non può funzionare correttamente senza questi cookie.&nbsp;&nbsp;Ulteriori tipologie di cookie presenti in questa categoria sono unicamente di tipo anonimo.','I cookie per le preferenze consentono a un sito web di ricordare le informazioni che influenzano il modo in cui il sito si comporta o si presenta, come la lingua preferita o la regione di appartenenza dell’utente.','I cookie statistici aiutano a capire come gli utenti interagiscono con i siti raccogliendo e trasmettendo informazioni in forma anonima.',' I cookie per il marketing vengono utilizzati per monitorare gli utenti nei siti web. L\'intento è quello di visualizzare annunci pertinenti e coinvolgenti per il singolo utente.','I cookie non classificati sono i cookie che sono in fase di classificazione, insieme ai fornitori di cookie individuali.','OK','Accetta tutti','Accetta selezionati','allowselectdecline','Nascondi i dettagli ','Mostra dettagli','Personalizza','Non vendere n&#233; condividere le mie informazioni personali ');
